INSERT INTO `t_faq` VALUES ('1', '5', '怎么交电费', '缴费渠道有网上营业厅、自助终端、微信、支付宝、银行自助终端、银行委托代扣、转账缴费、银行现金代缴、营业厅POS机便民点代收、QQ钱包等', '12', '138', '2017-12-06 23:37:17', '0');
INSERT INTO `t_faq` VALUES ('2', '2', '对居民散户电能表表位有何要求', '您好！居民客户的表位一般应满足以下要求：在便于电源进线的处所，如平房在院内室外墙上，行排房屋集中装在靠近接户线进线的室外墙上，旧式楼房一律装在首层公用楼道内，新式楼房应装在楼层的外走廊配电房里。一律不应安装在居民室内。不得安装在潮湿、烟熏及有腐蚀性气体的场所。如在室外露天装设时，必须有可靠的防雨雪侵入和防雨漏的措施。', '6', '138', '2017-12-18 17:44:57', '0');
INSERT INTO `t_faq` VALUES ('3', '4', '居民合表办理流程', '（1）城乡居民自建多、高层住宅客户可申请执行合表电价。业主携带身份证、电费通知单（电费发票）前往当地供电营业厅办理相关手续。 （2）对于城乡居民自建多、高层住宅客户申请按照合表电价计收电费的，业扩（或用检）人员上门核实该客户是否符合标准（详见第22条），并对楼体、内部结构等典型特征拍照存档（资料在营销系统登记上传存档）。 （3）客户申请由一户一表改为合表用户、由一户一表阶梯计费改为峰谷分时计费等计费类型变更的，通过现有的改类流程（MKT2.08）办理。', '9', '138', '2018-01-24 13:19:10', '0');
INSERT INTO `t_faq` VALUES ('4', '4', '居民合表政策 ', '（1）合表用户分合表居民用户和执行居民电价的非居民用户,包括：①未抄表到户的统建住宅（包括商品房和机关企事业单位自建住宅、政府公租房）；②住宅小区中执行居民电价的公共用电；③执行居民电价的非居民用户（如学校、集体宿舍等）。（2）对于城乡居民自建多、高层住宅的居民用户,可向供电企业提出申请,由供电企业核实认定后,按照合表居民用户电价政策计收电费。注：单元式住宅结构是指在多层、高层楼房中的一种住宅建筑形式。通常每层楼面只有一个楼梯,住户由楼梯平台直接进入分户门。', '9', '138', '2018-01-24 13:19:10', '0');
INSERT INTO `t_faq` VALUES ('5', '4', '拆表所需资料', '拆表办理需提供以下资料（1）客户本人身份证明材料；（2）经办人身份证明材料及授权委托书（非本人办理需提供）；（3）如涉及的表后线路改造,需提供《电工进网作业许可证》、施工单位资质等材料。', '9', '138', '2018-01-24 13:19:10', '0');
INSERT INTO `t_faq` VALUES ('6', '4', '改压要怎么办理', '改压办理需提供以下资料（1）客户本人身份证明材料；（2）经办人身份证明材料及授权委托书（非本人办理需提供）；（3）如涉及客户受电工程或表后线路改造,需提供《电工进网作业许可证》、施工单位资质等材料。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('7', '4', '移表要带什么资料', '移表办理需提供以下资料（1）客户本人身份证明材料；（2）经办人身份证明材料及授权委托书（非本人办理需提供）；（3）涉及的客户受电工程改造或表后线路,需提供《电工进网作业许可证》、施工单位资质等材料。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('8', '4', '充电桩支持的车型', '充电桩支持的车型有（一）北汽：北汽EV150/EV160/EU260/EV200,北汽绅宝EV,共五款车型。（二）吉利：吉利帝豪EV（三）东风：东风日产启辰（四）长安：长安EADO（五）比亚迪：E6（国标版BMS协议,非早期市场上用的普天版BMS协议）（六）腾势（七）具有国标版BMS协议的其他车型注：以上车型均为纯电动车,目前市场上的混合动力车均无直流充电口,不具备快充功能。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('9', '4', '阶梯分时', '“先分时,后阶梯”计算方法。即先按照峰、平、谷各时段用电量和对应电价计算全部电量的基础电费,再按照第二档、第三档用电量及其加价标准,分别计算第二档、第三档电量的加价电费,基础电费与加价电费之和为居民总电费。选择执行峰谷电价的居民用户,其峰谷分时计量表计由电网企业免费安装,用户选择实施后的一年内不得变更。', '10', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('10', '4', '供电方案的期限', '《供电服务监管办法》规定向用户提供供电方案的期限为,自受理用户用电申请之日起,一般居民用户不超过5个工作日,低压电力用户不超过10个工作日,高压单电源用户不超过30个工作日,高压双电源用户不超过60个工作日', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('11', '4', '一户一表的相关规定。', '《供电营业规则》75条规定：城填居民用电应实行一户一表。特殊原因不能实行一户一表时，供电企业可根据其容量按公安门牌或楼门单元、楼层安装共用计费电能表，居民客户不得拒绝合用。共用计费电能表内各客户，可自行装设分户电能表，自行分算电费，供电企业在技术上予以指导。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('12', '4', '为什么暂缓办理客户的报装业务？', '《供电营业规则》第18条规定：如因供电企业供电能力不足或政府规定限制用电项目，供电企业可通知用户暂缓办理。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('13', '4', '南网的服务承诺', '《中国南方电网公司供电服务承诺》规定向用户提供供电方案的期限,自受理用户用电申请之日起,一般居民用户不超过3个工作日,低压电力用户不超过7个工作日,高压单电源用户不超过15个工作日,高压双电源用户不超过30个工作日', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('14', '4', '分布式光伏发电补贴政策', '1）光伏电站执行价格主管部门确定的光伏发电上网电价,不属于分布式光伏发电补贴范围;2）享受金太阳示范工程补贴资金、太阳能光电建筑应用财政补贴资金的项目不属于分布式光伏发电补贴范围;3）未纳入国家发电财政资金补贴目录的分布式光伏发电项目不属于分布式光伏发电补贴范围。（是否属于金太阳示范工程可在国家财政部、科技部、能源局网站上查询）', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('15', '4', '增容所需资料', '办理增容需要提供1、客户身份证明资料2、法定代表人身份证明资料主要指《营业执照》、《组织机构代码证》、《社团法人执照》等证件上对应法定代表人的身份证、户口簿、军人证（现役）、护照和回乡证（台胞证）。以上任意一种3、用电地址产权权属证明资料4、如需他人经办,提供经办人身份证明资料及委托书经办人身份证明：指居民身份证、户口簿、军人证（现役）、护照和回乡证（台胞证）。以上任意一种5、如需办理银行代扣,提供缴费资料交电费挂钩的存折（银行借记卡）、开户证明（开户许可证）、开户人身份证或加盖公章复印件等。', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('16', '4', '暂停用电所需资料', '暂停用电需要提交1、客户身份资料个人名义办理:由客户携带本人身份证（户口簿、军人证（现役）、护照；回乡证（台胞证））（正本）亲自办理。单位企业名义办理:单位企业本人是指法定代表人或由法定代表人授权委托的人员。被委托人必须是法定代表人所属企业员工,办理业务时被委托人需提交企业版《授权委托书》、被委托人身份证明资料及其与企业的社保关系证明。公司、企业：指《企业法人营业执照》、《营业执照》、《组织机构代码证》以及【法人身份证】。社会团体:《社团法人执照》、《组织机构代码证》以及【法人身份证】。2、施工单位资质材料施工、设计单位资质证,营业执照及工程委托书', '9', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('17', '4', '电费异常', '电费异常需1、确认是否有因换表或业务变更等电费退补信息。2、如没有换表情况,则对比往年用电情况,分析其用电规律。建议考虑因天气变化原因导致用电量加大等原因,或考虑是否有新增用电设备原因。3、认为没有以上原因时,可能存在多抄情况。可抄读目前电表行度,对比系统记录度数是否有异常情况。4、如发现有多抄情况,我局将派人员上门核实处理。5、建议考虑是否室内电器设备漏电情况,建议找有资格的维修公司或电工进行线路检查、处理。6、如没有上述情况,可尝试申请验表。', '10', '138', '2018-01-24 13:19:11', '0');
INSERT INTO `t_faq` VALUES ('18', '4', '批量报装所需资料', '1、用电业务单2、客户身份证明资料；3、经办人身份证明资料及授权委托书（客户本人办理无需此项）；4、用电地址物业权属证明资料；（原用电范围内增容用电无需提供该项资料）5、办理银行划扣电费的客户需提交的相关缴费资料；（增容用电无需提供）6、供电监管机构明文要求提供的其它资料；7、经规划部门审核通过的规划资料（如规划图、规划许可证等）。', '9', '138', '2018-01-24 17:54:05', '0');
INSERT INTO `t_faq` VALUES ('19', '4', '用电申请所需资料', '1用电资料（一般包括工程项目批准文件以及用电地址、用电性质、用电设备清单、用电负荷、保安电力、用电规划等）。2用户的身份证明材料3经办人身份证明资料。4用户授权委托书（非由用户亲自办理、或非单位法定代表人、负责人亲自办理时出具）。5用电地址物业权属证明材料。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('20', '4', '缴费渠道', '缴费渠道有网上营业厅、自助终端、微信、支付宝、银行自助终端、银行委托代扣、转账缴费、银行现金代缴、营业厅POS机便民点代收、QQ钱包等', '10', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('21', '4', '电磁辐射标准', '按国家规定,500千伏、110千伏、220千伏及330千伏送变电工程电磁辐射环境影响的评价标准中,公众总受剂量（包括已有电磁辐射背景影响和拟建项目设施可能或已经造成影响之和）不应大于国家《电磁辐射防护规定》的标准。对于单个项目的影响可取上述标准中场强限值的二分之一,或功率密度限值的二分之一。关于高压送变电设施的工频电场、磁场强度限值目前尚无国家标准。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('22', '4', '烂尾楼客户如何办理报装？', '按国家政策，房地产开发必须相应配套供配电设施，统一规划，统一办理报装。配套供配电设施投资打入房地产开发成本中。出现烂尾楼后，首先整体供配电配套设施资金无法落实，其次是电源和线路未架设，单个体的报装也无法办理。客户可寻求当地管理部门的协调，供电企业也会积极配合。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('23', '4', '临时用电规定', '按照国家的规定,对基建工地、农田水利、市政建设等非永久性用电,可供给临时电源。 临时用电期限除经供电部门准许外,一般不超过三年时间,逾期不办理延期或永久性正式用电手续的,供电部门将终止供电。使用临时电源的客户不得向外转供电,也不得转让给其他客户,供电部门也不受理其变更用电事宜。临时用电结束后,应按新装用电办理永久用电。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('24', '4', '什么是报装容量', '报装容量：供电双方共同确定的当期新装、增容、减容等容量。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('25', '4', '变损电费', '变损电费等于变损电量乘以电度电价,变损电量客户可查表得出：查《广东省变压器损耗及功率因数计算方法和查对表》,根据变压器的容量、损耗类型、月用电量、考核的功率因数即可查得变损电量。', '11', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('26', '4', '变损及功率因素', '变损电量的收取是根据粤电用[1998]8号文的《广东省变压器损耗及功率因数计算方法各查对表》而得。', '10', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('27', '4', '充电桩的操作说明', '充电桩侧面有操作指引说明,请您阅读操作流程后,按流程可以正常充电。（一）将充电枪插入电动汽车充电接口。（二）使用手机app或微信公众号扫描屏幕的二维码启动充电。（三）使用手机启动充电并查看充电状态。（四）使用手机app停止充电,或在充电桩屏幕点击“结束”按钮停止充电（五）完成充电,将充电枪归位。注意事项：（一）充电前请确认充电接口无水渍、无异物、电源线无破损。（二）禁止在充电过程中拔出充电枪、启动车辆。（三）非紧急异常情况下,禁止随意触碰“急停”按钮。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('28', '4', '什么是低压客户', '低压客户是指供电电压为220/380v的客户。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('29', '4', '电费复核单', '电费复核单可在客户用电档案中电费台账信息里查询', '12', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('30', '4', '电量多', '电量多请检查自家电器是否存在长期待机的热水器或者饮水机等。如没有,可到附近的营业厅申请验表。', '11', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('31', '4', '城乡结合部村民办理报装为什么需到当地国土所出具证明？', '对于手续齐全，符合规划的村民用电不需要出具国土所证明，我们都给予办理。对手续不齐全，没有房产证、规划建设许可证的用户报装，我们需要国土规划部门给予协助确认。城乡结合部及农村建房的用电报装往往牵涉到违章建筑、抢建和违反规划用地等问题，政府每年都发现相当多的非法建筑，需要我们配合拆迁停电。因此，按规定，对暂时没有拿到房产证、国土证的客户，用电报装时需要提供当地镇一级规划办提供的', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('32', '4', '变更增值税发票', '恩平供电局用户变更增值税发票信息需要携带：1、新营业执照2、法人身份证3、开票资料证明（内容包含：企业名称、税号、开户行、帐号、地址）,所有资料要提供正本及影印件并盖公章,4、经办人身份证加盖公章。鹤山供电局用户变更增值税发票信息需要携带：1、新营业执照2、法人身份证。蓬江供电局用户变更增值税发票信息需要携带：业主身份证明材料（个人身份证或营业执照、法人身份证）、银行开户证明、客户编号；委托办理情况下需携带委托协议、委托办理人身份证件。客户到营业厅领取申请表格后需盖公章,由于某些客户情况特殊,具体建议客户到营业厅咨询。台山供电局用户变更增值税发票信息需要携带：1、三证合一证书2、工商核准通知书3、法人代表身份证复印件4、开户许可证(即基本户开户许可证)如果不是法人代表亲自来办理,需再补充:1、代办委托书2、社保记录证明。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('33', '4', '买楼后要怎么申请用电？', '凡在住宅小区、大厦等购买的住宅楼,一般有三种方式：一是业主购房后自行办理；二是委托开发公司或物业管理公司办理；三是以开发商或物业管理公司的名义统一报装,再办理用电变更手续。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('34', '4', '什么是光伏发电？', '分布式光伏发电项目是指位于客户所在地附近,不以大规模远距离输送电力为目的,所生产的电力以客户自用和就近利用为主,多余电力送入当地配电网的光伏发电项目。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('35', '4', '峰谷电价', '峰谷电价是指在一天不同的时间段内,制定不同价格的电价。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('36', '4', '高可靠性供电客户指什么？', '高可靠性供电客户是指对重要客户和其他客户的一、二级负荷,应申请高可靠性供电。高可靠性供电客户应根据广东省物价局《转发国家发展改革委关于停止收取供配电贴费有关问题的补充通知》（粤价〔2004〕72号）要求收取高可靠性供电费用。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('37', '4', '什么是高压客户', '高压客户是指供电电压为35kV及以上的客户。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('38', '4', '报装变压器，变压器是否一定要向供电局购买，并由供电局安装？', '根据《供电服务监管办法》规定，供电企业不得对用户受电工程指定设计单位、施工单位和材料供应单位。因此,客户可自主购买符合国家技术标准的变压器;自主委托有资质的施工企业安装，工程竣工经供电企业查验合格后可投入使用.', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('39', '4', '检修停电要不要收基本电费？', '根据《供电营业规则》第84条关于“事故停电、检修停电、计划限电不扣减基本电费”的规定，用户计划限电期间的基本电费照常收取，不得减免。', '12', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('40', '4', '备用变压器是否计收基本电费？', '根据《供电营业规则》第85条，“属冷备用状态并经供电企业加封的，不收基本电费；属于热备用状态的或未经供电企业加封的，不论使用与否都计收基本电费”。', '11', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('41', '4', '为什么要收电费保证金？', '根据广东省电力工业局《关于停止征收电费和电能表保证金的通知》（粤电用［2000］5号）文的要求，从2002年2月3日起，停止征收电费和电能表保证金。但对于①信用等级C级客户；②电费回收高风险客户；③低压非居民客户，需在银行电费信用担保和收取预付费中二选一。', '11', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('42', '4', '更换受电设备指什么？', '更换受电设备指客户为保证正常用电、提高用电安全水平或节能改造需求,在接线方式及装见容量不变的情况下,更换故障、烧坏、存在缺陷或能效差的受电设备。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('43', '4', '供电部门的业务的办理时限', '供电部门的业务办理时限分别为：一般居民客户不超过3个工作日；低压电力客户不超过7个工作日；高压单电源客户不超过15个工作日；高压双电源客户不超过30个工作日。对客户受电工程设计文件和有关资料审核的期限：低压电力客户不超过10个工作日,高压电力客户不超过30个工作日。装表接电时限：具备供电条件的客户自办结用电手续之日起,一般居民客户3个工作日内装表接电；其它低压电力客户在5个工作日内装表接电；高压电力客户在7个工作日内装表接电。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('44', '4', '为什么没有接到催费通知？', '供电企业对电费催收工作有明确的工作流程和严格的考核制度，按照《供用电合同》用电客户需在每月15日前结清当期电费，经过多次批量划扣电费后，对于未缴交电费的用户，我们就会陆续多次上门派发催费通知、电话以及短信方式进行催费。但由于部分用户没有信箱或报装时提供的用电地址不详，会导致催费单无法投递成功。此外，您的电话、手机号码发生变更后如没有及时通知我们更改，也会导致我们无法通过电话或短信向您发出提醒。', '10', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('45', '4', '态度差', '很抱歉给您带来不便,我们会继续改进的。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('46', '4', '住宅可否报装三相电？', '家庭一般不宜装设三相电。单相电对家庭来说均可满足要求,家庭用电器都按单相220v电源设计,一般均可匹配使用。三相电电压为380v,比单相电电压高很多,家庭环境安全难以保证,增加触电危险及触电致死率高,因此最好不要使用三相电。', '9', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('47', '4', '居民电价是怎样的？', '居民用电执行阶梯电价是从2012年7月1日开始,将电量分档为夏季和非夏季标准。每年的5-10月执行夏季标准,其余非夏季标准。夏季标准：第一档电量为每户每月0-260千瓦时,单价0.62元；第二档电量为每户每月261-600千瓦时,单价0.67元；第三档电量为每户每月601千瓦时及以上,单价0.92元。非夏季标准：第一档电量为每户每月0-200千瓦时；第二档电量为每户每月201-400千瓦时；第三档电量为每户每月401千瓦时及以上的。', '10', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('48', '4', '居民用户过户需要什么资料', '居民用户办理过户需携带：用电业务单；新、原户的身份证明资料、缴费资料；用电地址产权权属证明资料。若原户无法联系且已缴清电费的,则新户按新装业务提交资料,并提供用户声明。非居民用户办理过户需携带：用电业务单；新、原户的身份证明资料、缴费资料；用电地址产权权属证明资料。原户在业务单上盖公章,如公章已注销,应提交工商核销证明；新户按新装业务提交资料；原户以个人名义报装的,则提供原户身份证明资料,新户按新装业务提交资料；原户无法联系,则新户按新装业务提交资料,并提供客户声明。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('49', '4', '居民用户更名需要什么资料', '居民用户需提供用电业务单、新户、原户身份证明资料。非居民用户需提供用电业务单、工商核准变更通知单。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('50', '4', '什么是竣工检验', '竣工检验指对客户受电工程总体竣工后的工程检验。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('51', '4', '绝缘工具检测', '客户绝缘工具需进行检测,客户可委托有资质的施工单位进行检测。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('52', '4', '电工考试', '电工考试，客户可登陆南方能源监管局网站（http://nfj.nea.gov.cn/）查询,除此之外,南方能源监管局（即原电监会）在开平四维培训中心设点提供电工进网许可证培训或咨询（开平四维培训中心地址：开平市水口镇开锋村委会红山四维培训公司,联系电话：0750-2735400）。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('53', '4', '如何更改客户信息资料', '客户可通过拨打95598服务热线提出更改电话、通讯地址、邮箱、联系人姓名、客户服务密码等客户信息的需求。95598坐席员通过对客户的、户名、户号、银行账号后六位数、联系人姓名、联系人电话等基础信息任意抽取三个进行确认后可直接办理,若是企业客户,则需确认企业的营业执照编号、机构代码等。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('54', '4', '什么是客户受电工程', '客户受电工程指客户为满足自身用电需求而实施的接受与分配电能电气装置,是位于产权分界点客户侧的电力线路部分和客户受电变（配）电站等电气设施建筑工程的总称。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('55', '4', '临时供电客户指什么', '临时供电客户是指对基建工地、农田水利、市政建设等非永久性用电,可供给临时电源。临时供电客户应根据广东省物价局《转发国家发展改革委关于停止收取供配电贴费有关问题的补充通知》（粤价〔2004〕72号）要求收取临时接电费用。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('56', '4', '什么是零散居民客户', '零散居民客户是指非批量办理居民低压新装、增容用电的客户。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('57', '4', '低压用电报装有什么程序', '您好！低压用电报装一般经过如下程序：首先,客户向供电部门提出用电报装申请供用电双方确定供电方案,供用电双方签订供用电合同,之后供电部门会进行装表送电。具体手续请到当地供电营业机构咨询办理。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('58', '4', '为何安装互感器', '您好！电表过电流有一定限度,超过限度就应配互感器。把电流按比率变换成小电流进入电表计量,计电费时按该比率进行电量核算。其电量计算和直读直抄是完全是一致的,其计量精度完全符合国家标准,请您不必担心。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('59', '4', '计量装置的安装点或位置', '您好！电能计量装置原则上应装在供电设施的产权分界处。如产权分界处不适宜装表的,对专线供电的高压客户,可装在变电站侧或客户受电装置侧计量；对公用线路供电的高压客户,可在客户受电装置的高压侧或低压侧计量。当用电计量装置不安装在产权分界处时,线路与变压器损耗的有功与无功电量由产权所有者负担。', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('60', '4', '缴费卡丢失怎么办', '您好！缴费卡是您缴交电费的依据,为了保证您提供的户号准确,请您提供缴交电费的发票或供电部门向您邮寄的电力帐单,我们将免费为您补办,谢谢！', '7', '138', '2018-01-24 17:54:06', '0');
INSERT INTO `t_faq` VALUES ('61', '4', '居民客户的表位要满足什么要求', '您好！居民客户的表位一般应满足以下要求：在便于电源进线的处所,如平房在院内室外墙上,行排房屋集中装在靠近接户线进线的室外墙上,旧式楼房一律装在首层公用楼道内,新式楼房应装在楼层的外走廊配电房里。一律不应安装在居民室内。不得安装在潮湿、烟熏及有腐蚀性气体的场所。如在室外露天装设时,必须有可靠的防雨雪侵入和防雨漏的措施。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('62', '4', '支付宝缴费', '您好,如需支付宝缴费,请登录支付宝app内的生活缴费功能（更多—生活缴费—电费）,选择所在城市和选择缴费单位为广东电网公司（银行代收）,然后输入客户编号后进行缴费,谢谢。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('63', '4', '抄表差错安抚', '我局将派人员上门核实跟进。确认抄错后一般如果还没有收取客户费用,则将行码改正后并计费出新的电费；若收取了客户的费用,会将多收的费用转为预收电费；如客户不愿意转为预收电费则走退费流程。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('64', '4', '95598电话', '详细请咨询客服电话95598,谢谢！', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('65', '4', '光伏怎么办理？', '项目业主除提供与用电客户相同的资料外,需再提供省能源主管部门出具的证明或意见、项目业主与提供光伏建设用地单位合作协议（包括同能源、屋顶租赁、安全责任协议、运行维护协议等）。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('66', '4', '小区车库和单车房怎么报装？', '小区车库和单车房如果是独立的房产证可办理报装用电,设独立电表,手续与普通报装相同。如果是商品房的附属部分（无独立房产证）,则不能办理独立用电户,应与主物业共表用电,或由物业内部安装分表用电。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('67', '4', '新电表不准', '新电表在投入使用前,是必须经过严格鉴定检测,合格（误差在允许范围内）的我公司才允许安装使用,客户完全可以放心使用,不需要担心计量不准确问题。由于旧电表运行时间较长,机械老化等多方面原因可能导致个别旧电表计量精度不够,导致计量不准,出现多计或少计电量问题,为防止出现该问题,我公司会安排对电表进行免费定期轮换,保证计量准确性。对电表的精度有怀疑,用户也可直接委托质量技术监督部门进行检查。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('68', '4', '业扩工程投资界面', '新业扩工程投资界面的执行的时间节点为2015年9月1日。8月31日当天及以前已签订《供电方案协议》的客户按协议执行,9月1日起签订《供电方案协议》的客户按新投资界面标准执行。如果客户对执行标准存在疑义的,请留下联系方式和公司名称,之后将提级到专人进行答复。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('69', '4', '同个公司的不同地址,索取发票', '需要出具营业执照、税务登记证、法人代表身份证等,同时总公司（即税务登记证对应的用户）要出具函,说明旗下的用户（用户号、用户名、结算户号、结算户名、用电地址）为同一用户,并且盖上公章。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('70', '4', '什么是业扩', '业扩：又称业务扩充,指为客户办理新装、增容、变更用电和其他业务手续,包括业务受理、现场勘查、确定及答复供电方案、受电工程设计资料审核、中间检查、竣工检验、签订供用电合同、装表接电和建立客户档案等工作环节。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('71', '4', '居民银行托收资料', '一：用电客户身份证明资料 1、公司、企业：《企业法人营业执照》或《组织机构代码证》或《营业执照》、法人身份证 2、社会团体：《社团法人执照》或《组织机构代码证》、法人身份证 3、机关、事业单位、其他组织：上级单位证明文件；政府、行业主管部门批准其成立的文件或政府、行业主管部门颁发的有关证照、证明或《组织机构代码证》，负责人身份证 4、个人：居民身份证或军人证（现役）或护照或户口簿或护照或回乡证（台胞证） 以上内容，根据客户性质选择其一 二：经办人身份证明资料（客户本人办理，无需此项） 1、居民身份证或军人证（现役）或护照或户口簿或护照或回乡证（台胞证） 2、委托他人办理用电报装，需提供办电授权委托书 第1点任选其一 三：电费缴交帐户资料 1、银行存折（银行借记卡）或开户证明（开户许可证）或加盖公章的银行帐户资料 2、开户人身份证明材料（与用电客户身份证明资料相同的不需重复提供） 缴费方式为“银行代扣”、“银行托收”等方式时第1点任选其一', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('72', '4', '非居民新装资料', '一：用电客户身份证明资料二：经办人身份证明资料　[客户本人（法人）办理无需此项]三：用电地址物业权属证明资料四：规划、用地证明资料（此项只针对提供《土地使用权证》,如用户提供其它证明的,用户无需提供此项证明）五：电费缴交帐户资料1、银行存折（银行借记卡）或开户证明（开户许可证）或加盖公章的银行帐户资料2、开户人身份证明材料（与用电客户身份证明资料相同的不需重复提供）六：开具增值税发票所需的资料（不需开具增值税发票,无需此项）七：报装表格', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('73', '4', '基本电费', '一个工业用户有多个受电点的,以每一个受电点作为一个计费单位。凡变压器部容量达到315KVA的受电点,执行大工业电价,按该点的变压器部容量计算基本电费；变压器总容量达不到315KVA的受电点,执行普通工业电价,不计基本电费。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('74', '4', '两种以上的电价', '一个客户有两种以上不同电价类别的,应分别装表计量；未能分表计量的,应根据不同电价类别的用电设备容量的比例或实际可能用电量,确定不同的电价类别的用电量比例或定量进行分算,分别按相应的电价计算电费。供电部门每年至少对上述比例或定量核定一次。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('75', '4', '电网公司延伸业扩工程投资界面的原因是什么？', '一是为落实国家加大投资部署，主动承担社会责任，支持经济社会发展，为我省创造更良好的创业投资环境。二是降低客户用电报装成本，切实解决客户用电“最后一公里”的问题。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('76', '4', '用电户报装资料', '一用电客户身份证明资料二：经办人身份证明资料　[客户本人（法人）办理无需此项]1、居民身份证或军人证（现役）或护照或户口簿或护照或回乡证（台胞证）2、委托他人办理用电报装,需提供办电授权委托书三：用电地址物业权属证明资料四：规划、用地证明资料（此项只针对提供《土地使用权证》,如用户提供其它证明的,用户无需提供此项证明）五：申请办理城乡“低保户”和农村“五保户”免费电需提供证明。六：电费缴交帐户资料六：报装表格《居民客户用电业务受理表》（系统打印）、《用电设备容量清单》', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('77', '4', '什么是电费违约金？如何计算?', '因用户逾期交电费所加收的款项，叫电费违约金。依据国家《供电营业规则》九十八条规定，用户在供电企业规定的期限内未交清电费时，应承担电费滞纳的违约责任。电费违约金从逾期之日起计算至交纳日止。每日电费违约金按下列规定计算： 1）居民用户每日按欠费总额的千分之一计算； 2）其他用户： (1)当年欠费部分，每日按欠费总额的千分之二计算； (2)跨年度欠费部分，每日按欠费总额的千分之三计算。 电费违约金收取总额按日累加计收，总额不足1元者按1元收取。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('78', '4', '什么是隐蔽工程', '隐蔽工程是指客户受电工程中,正常运行时被掩埋或覆盖的电力设施施工工程。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('79', '4', '永久居民办理新装、增容业务需携带资料', '永久居民办理新装、增容业务需携带 ①用电业务单； ②客户身份证明资料； ③经办人身份证明资料（若客户本人办理无需此项）； ④用电地址物业权属证明资料（原用电范围内增容用电无需提供该项资料）； ⑤办理银行划扣电费的客户需提交的相关缴费资料（增容用电无需提供）； ⑥供电监管机构明文要求提供的其它资料； ⑦对申请办理城乡低保户和农村五保户免费电的,须提供具有民政部门签发的低保/五保有效证件、身份证、户口薄,并在民政部门提供的低保/五保户认定清单上能够查到对应信息。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('80', '4', '租来的房子，可否办理报装？', '用电报装的对象是房产业主，以便确立双方权利和义务。你承租的房子如果符合用电报装条件的，可由你的业主来办理用电报装。如确实有特殊要求需以你的名义报装的话，则业主需作担保并办理担保手续。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('81', '4', '用电报装的流程', '用电报装一般流程：用电报装（客户）→确定供电方案（供用电双方）→委托设计（客户）→设计资质、图纸审查（供电企业）→工程委托施工（客户）→施工单位资质审查（供电企业）→工程中间查验（供电企业）→工程竣工报验（施工单位或客户）→工程竣工查验（供电企业）→签订供用电合同（供用电双方）→装表送电（供电企业）。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('82', '4', '临时用电资料', '用电客户身份证明资料、经办人身份证明资料、用电地址物业权属证明资料、规划、用地证明资料、开具增值税发票所需的资料、税务登记证、一般纳税人资格证、报装表', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('83', '4', '新会变更增值税发票', '用户办理三证合一需变更增值税发票信息,需携带资料如下：1、机构信用代码证；2、法人授权委托书；3、法人身份证；4、代办人身份证；5、公司证明；6、核准变更登记通知书；7、营业执照；8、公章；最终解释权以各供电营业厅要求为准！', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('84', '4', '江海变更增值税发票', '用户变更增值税发票信息需要携带：三证合一的复印件盖公章、法人身份证盖公章、填写申请表并盖上公章。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('85', '4', '对验表结果有异议', '用户对检验结果有异议时,可向供电企业上级（如：市技术监督局或省电力中心试验所）计量检定机构申请检定,在申请验表期间,电费仍应按期交纳,验表结果确认后,再行退补电费。退补电量未正式确定前,用户应先按正常月用电量交付电费。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('86', '4', '欠费复电', '用户交清欠费后,可通知供电营业厅或致电95598,供电企业会安排人员在当天内恢复供电。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('87', '4', '验表', '用户可以携带户主身份证明资料、电费单或者电费发票到所属营业厅办理验表手续。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('88', '4', '申请安装一台专用变压器，办理手续多长时间？', '用户提出用电申请后，供电企业首先确定供电方案。 《中国南方电网公司供电服务承诺》规定向用户提供供电方案的期限，自受理用户用电申请之日起，一般居民用户不超过3个工作日，低压电力用户不超过7个工作日，高压单电源用户不超过15个工作日，高压双电源用户不超过30个工作日 给用户装表接电的期限，自受电装置检验合格并办结相关手续之日起，一般居民用户不超过3个工作日，低压电力用户不超过5个工作日，高压电力用户不超过7个工作日。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('89', '4', '“一口受理”需要提供哪些资料？', '用户在报装“一口受理”的时候，只需要提供户主名称、用电地址、经办人姓名、经办人手机四项资料，并选择或告知坐席报装类别（居民新装、居民增容、低压非居民新装、低压非居民增容、高压新装、高压增容或减容）即可。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('90', '4', '一口受理服务时限', '用户在网上或通过95598热线申请“一口受理”之后，工作人员会在1个工作日内联系用户。供电方案答复期限：居民客户、低压客户、高压单电源和高压双电源客户分别不超过3个、7个、15个和30个工作日。装表接电期限：居民客户、低压和高压客户分别不超过3个、5个、7个工作日。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('91', '4', '业扩工程不满意安抚', '由于目前我们的工作刚刚开展,相关耗时还不能明确,再加上近期会有大批客户扎堆办理业务,所以根据我们的经验,高压不少于18个月,中压不少于4个月,低压不少于10个工作日,假如在中高压延伸工作开展中遇到一些特殊问题（如青赔不能达成一致,线路走廊落实不及时等）,个别项目完成时间将会有所推迟。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('92', '4', '改电费历史通知单', '在电费发行后,如需要更改历史数据的用户,必须通过改单或退补等工作单严格执行相关审批流程,并根据涉及金额的大小划分审核权限。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('93', '4', '电费通知单', '在电费发行后的三个工作日内送达客户。委托派发电费通知单的,由客户服务中心在电费发行的当天把电费发行数据发送到相关单位,并在三个工作日内送达客户。电子邮件、手机短信等电子账单应在电费发行后的二个工作日内发送。如需变更派发电费通知单日期应履行审批程序。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('94', '4', '特殊优惠电价', '在现行电价政策中没有制定五保户、残疾人享受优惠电价的优惠政策,我局无权减免电费,所以五保户、残疾人不可以享受优惠电价。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('95', '4', '频繁停电', '在正常的电网建设、设备检修工作中,各供电部门一般安排同一条线路三个月内停电检修不超过一次,也就是三个月内停电不会多于一次；如果确实有多于一次的情况,可能是受不可抗力引起线路或变压器、开关等设备出现故障,被迫停电检修,或是供电设施被盗引起的,虽然我公司与公安开展了警企联合行动,取得了一定效果,还需要通过群防群治来解决,请广大客户积极配合,发现出现线路被盗或破坏电力设施的请致电95598或110反映,以便及早处理,保证电力供应。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('96', '4', '智能电表', '智能电表是智能电网的智能终端,除了具备传统电能表基本用电量的计量功能以外,为了适应智能电网和新能源的使用它还具有双向多种费率计量功能、用户端控制功能、多种数据传输模式的双向数据通信功能、防窃电功能等智能化的功能。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('97', '4', '供电方案的有效期', '中、高压客户供电方案的有效期为1年,低压客户供电方案的有效期为3个月,逾期注销。因特殊情况,供电方案在有效期限内需要变更的,供电企业应与客户充分沟通,合理调整、重新确定后书面答复客户。', '11', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('98', '4', '江门的缴费账号', '中国工商银行 开户名称：广东电网有限责任公司江门供电局 账号：2012002129022128389 开户行：中国工商银行江门分行港口支行 中国建设银行 开户名称：广东电网有限责任公司江门供电局 帐号：44001670101053000897 开户行：中国建设银行江门分行营业部 中国银行 开户名称：广东电网有限责任公司江门供电局 账号：800928706857760073 开户行：中国银行江门分行营业部 中国农业银行 开户名称：广东电网有限责任公司江门供电局 账号：44-370301040012266 开户行：中国农业银行江门分行营业部 中国邮政储蓄银行 开户名称：广东电网有限责任公司江门供电局 账号：100187335080010001 开户行：中国邮政储蓄银行江门分行 融和及农信社 蓬江（除杜阮、棠下、荷塘），江海 开户名称：广东电网有限责任公司江门供电局 账号：80020000003125064 开户行：江门融和农业商业银行股份有限公司 新会（含杜阮、棠下、荷塘） 开户名称：广东电网有限责任公司江门新会供电局 账号：80020000005032234 开户行：江门新会农村商业银行股份有限公司 鹤山 开户名称：广东电网有限责任公司江门鹤山供电局 账号：8002000000438716 开户行：鹤山农村信用社 开平 开户名称：广东电网有限责任公司江门开平供电局 账号：8002000000442199 开户行：开平市农村信息合作社联合营业部 台山 开户名称：广东电网有限责任公司江门台山供电局 账号：8002000000991681 开户行：台山市农村信息合作社联', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('99', '4', '江门的缴费银行', '中国银行、工商银行、建设银行、中国邮政储蓄银行、农业银行、融和农商银行等', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('100', '4', '什么是中间检查', '中间检查指对隐蔽工程的查验。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('101', '4', '什么是中压客户', '中压客户是指供电电压为10kV或20kV的客户。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('102', '4', '换新电表', '主要是因为机械式电能表随着使用时间的延长,机械的磨损,往往会产生计量不准的现象。为保证电能表的计量准确性,按有关规定需要定期拆回电能表,进行表计校验（也就是常说的表计轮换）。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('103', '4', '高层住宅供电方案', '住宅用电应设专用的低压供电系统,独立装表计量,应采用一户一表形式计量；高层住宅公用变压器后设客户专用低压配电房,由客户专用低压配电房新敷设低压母线至每层,在各层靠近电缆竖井适当位置安装表位；高层住宅的电梯、水泵、楼梯照明等公共用电独立设置电能计量装置；高层建筑的电梯等一类负荷应由客户自备保安电源。', '9', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('104', '4', '每月抄表时间规定', '专变客户每月1-2号进行抄表,公变客户（包括居民用户）每月1-11日进行抄表。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('105', '4', '什么是装机总容量', '装机总容量是指客户受电电压等级的变压器（含电动机）的总容量。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('106', '4', '竣工验收接电规定', '自受电装置检验合格并办结相关手续之日起,低压居民客户不超过3个工作日,低压非居民客户不超过5个工作日,中、高压客户不超过7个工作日。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('107', '4', '业扩报装时间', '自受理客户正式申请用电之日起,低压居民客户采用低压零散居民快速新装流程,低压非居民客户不超过2个工作日；中压单电源客户不超过5个工作日,中压双电源客户不超过7个工作日；高压单电源客户不超过15个工作日,高压双电源客户不超过30个工作日。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('108', '4', '竣工验收接电时间', '自受理之日起,低压客户不超过3个工作日,中、高压客户不超过5个工作日。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('109', '4', '租户报装问题', '租住户报装,个人住宅租住户用电应由业主办理报装用电。', '7', '138', '2018-01-25 11:55:15', '0');
INSERT INTO `t_faq` VALUES ('111', '4', '我的电表要过户怎么办理？', '要提供资料以下：1、联系人及联系方式   2、新产权证明文件复印件  3、新产权人身份证复印件 4、新缴费帐号复印件', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('112', '4', '我想增容怎么办理?', '办理增容需要提供1、身份证 2、房产证 3、如需他人经办,需提供经办人身份证明资料及委托书经办人身份证明 4、如需办理银行代扣,提供银行借记卡。', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('113', '4', '我原来是商业用电，现要改住宅用电怎么办理?', '要把商用电改为民用电可以到电力公司营业厅填写变更用电申请，如果是居民户，带上身份证、房产证，受理申请后，供电局的工作人员会到现场核实用电性质，来判别是否为居民生活照明用电，如果是，将按流程变更', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('114', '4', '我要销户怎么办理?', '1、签署销户用电登记 2、身份证或户口本 3、用电地址产权证明 4、用电地址产权人身份证明', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('115', '4', '我想更改缴费帐号怎么办理？', '要提供资料以下：1、新银行帐号 2、帐号开户人姓名及身份证', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('116', '4', '我要更改姓名怎么办理？', '居民用户需提供用电业务单、新户、原户身份证明资料。非居民用户需提供用电业务单、工商核准变更通知单。', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('117', '4', '我想迁移电表怎么办理？', '迁移电表需提供以下资料：（1）客户本人身份证明材料；（2）经办人身份证明材料及授权委托书（非本人办理需提供）；（3）涉及的客户受电工程改造或表后线路,需提供《电工进网作业许可证》、施工单位资质等', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('118', '4', '我家建房子想装个临时电表怎么办理？', '要提供资料以下：1、用电客户身份证明资料2、经办人身份证明资料3、用电地址物业权属证明资料、用地证明资料4、报装表', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('119', '4', '我怀疑我家电表有问题，我想申请校验怎么办理？', '你如果对电表的准确性产生怀疑，可携带电费单、户主身份证前往当地供电局申请校验', '8', '138', '2018-02-08 14:21:11', '0');
INSERT INTO `t_faq` VALUES ('121', '4', '新房子通电要我自己办理吗？', '凡在住宅小区、大厦等购买的住宅楼，一般有三种方式：一是业主购房后自行办理；二是委托开发公司或物业管理公司办理；三是以开发商或物业管理公司的名义统一报装，再办理用电变更手续。', '9', '138', '2018-03-10 12:13:40', '0');
INSERT INTO `t_faq` VALUES ('123', '4', '附近的停车场有哪些?', '附近的停车场有：杨协成电子创意园停车场，华客隆购物商场停车场，南洲小聪科技创意园停车场', '9', '138', '2018-03-10 12:51:32', '0');
INSERT INTO `t_faq` VALUES ('124', '4', '附近的加油站有哪些？', '附近的加油站有：敦和加油站，中油广通加油站，菜电加油站', '9', '138', '2018-03-10 12:53:38', '0');
INSERT INTO `t_faq` VALUES ('125', '4', '我漂亮吗', '主人，全世界最美的人就是你', '9', '138', '2018-03-10 13:05:52', '0');
INSERT INTO `t_faq` VALUES ('127', '4', '一户移表申请改为合表', '客户申请由一户一表改为合表用户，通过现有的改类流程（MKT2.08）办理。', '9', '138', '2018-03-13 11:45:28', '0');
INSERT INTO `t_faq` VALUES ('128', '4', '一户一表', '由一户一表阶梯计费改为峰谷分时计费等计费类型变更的', '9', '138', '2018-03-13 11:52:06', '0');
INSERT INTO `t_faq` VALUES ('129', '4', '功率因素调整电费', '功率因数调整费也是根据粤电用[1998]8号文的《广东省变压器损耗及功率因数计算方法各查对表》而查得的考核功率因数百分比乘以剔除三峡基金、城建附加费的总电费而得。', '10', '138', '2018-03-15 15:43:22', '0');
