INSERT INTO `t_nonexistent_faq` VALUES ('411', '美学。', '美学（希腊语：Aesthetica），是德国哲学家鲍姆加通在1750年首次提出来的。美学是研究人与世界审美关系的一门学科，即美学研究的对象是审美活动。审美活动是人的一种以意象世界为对象的人生体验活动，是人类的一种精神文化活动。美学属哲学二级学科，目前国内多所学校设立美学专业硕士点，该专业从属于中国语言文学。要学好美学需要扎实的哲学功底与艺术涵养', '2018-02-05 14:19:50');
